&lt;p&gt;Two statements are given followed by three conclusions numbered I, II and III. Assuming the statements to be true even if they seem to be at variance with commonly known facts, decide which of the conclusions logically follow(s) from the statement.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;No crows is a bird.&lt;/p&gt;

&lt;p&gt;All birds are animals.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusion:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. Some animals are crows.&lt;/p&gt;

&lt;p&gt;II. Some animals are birds.&lt;/p&gt;

&lt;p&gt;III. No animal is a crow.&lt;/p&gt;

hn.value:
&lt;p&gt;नीचे प्रश्न में दो कथन और उसके बाद I, II और III से अंकित तीन निष्कर्ष दिए गये हैं। आपको दिए गये कथनों को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। सभी निष्कर्षों को पढ़िए और निर्णय कीजिए कि दिये गये निष्कर्षों में से कौनसा/कौनसे निष्कर्ष ज्ञात तथ्यों को नजरंदाज करने पर कथनों का तार्किक रूप से अनुसरण करता है/करते हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;कोई भी कौआ पक्षी नहीं है।&lt;/p&gt;

&lt;p&gt;सभी पक्षी पशु हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. कुछ पशु कौवे हैं।&lt;/p&gt;

&lt;p&gt;II. कुछ पशु पक्षी हैं।&lt;/p&gt;

&lt;p&gt;III. कोई पशु कौआ नहीं है।&lt;/p&gt;

